results.description:
A forma mais barata para ligar para o estrangeiro e para outras cidades.
- chamadas gratuitas, chamadas pela Internet, ligar de retorno e sms de retorno;
- gravação gratuita de conversa durante a chamada telefónica;
- chamadas na falta de Internet;
- selecção automática do tipo de chamada, dependendo da qualidade de Internet;
- alteração de sua voz durante a conversa;
- recebe a entrada das chamadas, mesmo quando o programa está desligado;
- alta qualidade de voz com código de HD-Voice;
- você pode comprar o número virtual para o país que você precisa;
- os preços muito baixos para chamadas para diferentes países e cidades, bem como uma variedade de bônus;
- ganha para repor o balanço de amigos em um programa de afiliados multi-nível e telefona gratuitamente;
- efetua chamadas com iPad ou iPod;
- envia SMS e mensagens gratuitas para usuários de Callbacker;
- chamadas baratas para a China, EUA, França, Brasil, EAU, Alemanha, Kuwait, Egipto, México, Nigéria, Tailândia, Indonésia, Austrália, Reino Unido, etc.

This application is not approved by, sponsored by or affiliated with Skype or Microsoft. 
